import React, { useState } from 'react';
import api from '../services/api';

const Registration: React.FC = () => {
  const [name, setName] = useState('');
  const [age, setAge] = useState<number | ''>('');
  const [category, setCategory] = useState('MS');
  const [message, setMessage] = useState('');

  const submit = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      await api.post('/players/', { name, age, category });
      setMessage('Player registered successfully');
      setName('');
      setAge('');
    } catch (err: any) {
      console.error(err);
      setMessage('Failed to register player');
    }
  };

  return (
    <div style={{ padding: 16 }}>
      <h2>Player Registration</h2>
      <form onSubmit={submit}>
        <div>
          <label>Name</label><br />
          <input value={name} onChange={e => setName(e.target.value)} required />
        </div>
        <div>
          <label>Age</label><br />
          <input type="number" value={age as any} onChange={e => setAge(e.target.value === '' ? '' : parseInt(e.target.value))} required />
        </div>
        <div>
          <label>Category</label><br />
          <select value={category} onChange={e => setCategory(e.target.value)}>
            <option value="MS">Men Singles</option>
            <option value="WS">Women Singles</option>
            <option value="MD">Men Doubles</option>
            <option value="WD">Women Doubles</option>
            <option value="XD">Mixed Doubles</option>
          </select>
        </div>
        <div style={{ marginTop: 8 }}>
          <button type="submit">Register</button>
        </div>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
};

export default Registration;
